import React, { Fragment, useState } from "react";

import { Card, Avatar, Button, Input } from "antd";

const { Meta } = Card;

export default class Edit extends Comment {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    //   props.location.state.name
    //   props.location.state.order

    return (
      <Fragment>
        <Card
          title={this.props.location.state.title}
          cover={<img alt="" src={this.props.location.state.url} />}
          style={{ width: "400px" }}
        >
          <Meta
            title={<Input value={name} onChange={name => name.target.value} />}
            description={<Input />}
          />
        </Card>
        <Button
          style={{ width: "150px", margin: "1em 0" }}
          onClick={() => this.props.history.push("/order")}
        >
          Back to Order
        </Button>
      </Fragment>
    );
  }
}
